var obj=[];
let k = 0;
let p = 0;
let format = ''

let searchTerm = flow.get('zoekterm').toUpperCase()
for (let i = 0; i < msg.payload.dcat2_catalogs.length-1; i++) {

   for (let k = 0; k < msg.payload.dcat2_catalogs[i].dataservice.length; k++)
   {
      let r = msg.payload.dcat2_catalogs[i].dataservice[k]
      if (r.title[0].title.toUpperCase().includes(searchTerm) ||
         r.description[0].description.toUpperCase().includes(searchTerm))
      {
         /* bepaal formaat op basis van de URL */

         let z = r.endpointURL.toUpperCase()
         if (z.includes('WMS')) {
            format = 'WMS'
         } else if (z.includes('WFS')) {
            format = 'WFS'
         } else if (z.includes('CSV')) {
            format = 'CSV'
         } else if (z.includes('XLS')) {
            format = 'XLS'
         } else {
            format = 'onbekend'
         }

         obj[p] = {
         "catalog": 'DCAT2 catalogus',
         'title':r.title[0].title,
         'description': r.description[0].description,
         'accessurl': r.endpointURL,
         'format' : format
         }
         p++
      }
   }
}
msg.payload=obj
return msg;

